import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View } from "react-native";
import Searchbar from "./components/Searchbar";
import { Ionicons } from "@expo/vector-icons";
import { Feather } from '@expo/vector-icons';

export default function App() {
  return (
    <View style={{ flex: 1,
      flexDirection: "column",width:"100%",maxHeight: "100%",flex:1,alignItems:"center"}}>
      <Searchbar />
      <View style={styles.container}>
        <Text style={{marginTop:10}}>Kolkata</Text>
        <View style={{ marginTop: 30 }}>
          <Ionicons name="partly-sunny" size={50} color="black" />
        </View>
        <View style={{marginTop:10,flexDirection:"row"}}>
          <Text style={{ fontSize: 50 }}>16</Text>
          <Feather name="circle" size={14} color="black" />
        </View>
        <View style={{flexDirection:'row',justifyContent:'space-evenly',backgroundColor:"red"}}>
        <Ionicons name="rainy" size={24} color="black" />
        <Feather name="wind" size={24} color="black" />
        </View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: { 
    width:"90%",
    marginTop: 10,

  },
});
